import React, { useEffect } from 'react';
import '../../App.css';

export default function Services() {
  useEffect(() => {
    window.scrollTo(0, 0)
  }, []);
  
  return <>
    <img src='./images/img-2.jpg' />
    <h1 className='services'>SERVICES</h1>
  </>;
}
